  console.log(request.query);
  response.json(deleteTodos(request.query));
});


app.put('/todos', (request, response) => {
  response.json(updateTodos(request.query))
})

connectDb().then(() => {
  app.listen(server.PORT, (err) => {
    if (err) console.log(err);
    console.log("Listening PORT", server.PORT);
  });
});

export default app;

