  try {
    await client.connect(); // new connect caches the mongoDb. Will return cached one if exist.
    db = await client.db(DATABASE);
    console.log(`\n CONNECTED TO [${DATABASE}]\n`);
    return db;
  } catch (err) {
    console.error(`\n CONNECTION FAILED TO [${DATABASE}]`);
    throw err;
  }
}

